import React from 'react';
import MainLayout from 'layout/MainLayout';

const StudentsRoutes = {
  path: '/',
  element: <MainLayout />,
  children: [
    {
      path: 'students',
      element: <div>Hello</div> // Cambié <>Hello</> a <div>Hello</div> para mayor claridad
    }
  ],
};

export default StudentsRoutes;
